import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles/PropertiesAvailable.css'


const PropertiesAvailable = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get("https://localhost:5001/api/PropertiesAvailable")
      .then(response => {
        setProperties(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error("Error fetching properties", error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return (
      <div className="p-6 bg-gradient-to-b from-gray-50 to-gray-100 min-h-screen">
        <h1 className="text-3xl font-bold mb-8 text-indigo-700 relative pb-2 after:content-[''] after:absolute after:bottom-0 after:left-0 after:w-16 after:h-1 after:bg-indigo-700 after:rounded">
          Available Properties
        </h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
          {[...Array(6)].map((_, i) => (
            <div key={i} className="bg-gray-200 rounded-xl h-80 animate-pulse"></div>
          ))}
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 bg-gradient-to-b from-gray-50 to-gray-100 min-h-screen">
      <h1 className="text-3xl font-bold mb-8 text-indigo-700 relative pb-2 after:content-[''] after:absolute after:bottom-0 after:left-0 after:w-16 after:h-1 after:bg-indigo-700 after:rounded">
        Available Properties
      </h1>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {properties.map(prop => (
          <div 
            key={prop.id} 
            className="bg-white p-0 rounded-xl shadow-md overflow-hidden transition-all duration-300 hover:-translate-y-1 hover:shadow-lg"
          >
            <div className="relative">
              <img 
                src={prop.imageUrl || '/default-property.jpg'} 
                alt={prop.title} 
                className="w-full h-56 object-cover transition-transform duration-300 hover:scale-105" 
              />
              {prop.isFeatured && (
                <span className="absolute top-3 right-3 bg-white/90 px-3 py-1 rounded-full text-xs font-semibold shadow-sm">
                  Featured
                </span>
              )}
            </div>
            <div className="p-5">
              <h2 className="text-xl font-bold text-slate-800 mb-2">{prop.title}</h2>
              <p className="text-slate-600 mb-3 flex items-center gap-1">
                <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
                {prop.location}
              </p>
              <p className="text-indigo-600 font-bold text-lg mb-3">${prop.price.toLocaleString()} / month</p>
              <div className="flex justify-between items-center text-sm">
                <span className="text-slate-400 flex items-center gap-1">
                  <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z" />
                  </svg>
                  {prop.viewers} views
                </span>
                <button className="text-indigo-600 hover:text-indigo-800 font-medium">
                  View Details â†’
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertiesAvailable;
